import s from './Friends.module.css'
import Friend from "./Friend/Friend";

let friend = [
    {name: 'Arman', id: 1},
    {name: 'Nurik', id: 2},
    {name: 'Madya', id: 3},
    {name: 'Damik', id: 4},
    {name: 'Sam', id: 5},
]
const Friends = () => {
    return (
        <div className={s.items}>
            <Friend name={friend[0].name} id={friend[0].id}/>
        </div>
    );
};

export default Friends;
